import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';

class BankingReg extends Component {
  render () {
    return (
      <div>
      <div className='navbar2'>
      <NavLink to="/bankingReg" className="navButton"> Banking Regulations </NavLink>
      </div>
      </div>
    )
  }
}

export default BankingReg
